# required-method: assertGreaterEqual

class TestAssertGreaterEqual(TestCase):
    def test_you(self):
        assert abc >= 'xxx'

    def test_me(self):
        assert 123 >= xxx+y

    def test_everybody(self):
        assert 'abc' >= 'def'

    def test_message(self):
        assert 123+z >= xxx+z, error_message
        assert 123 >= xxx+z, error_message
